import styled from '@emotion/styled';

const CarouselWrapper = styled.div`
  width: 100%;
  display: flex;
  overflow: hidden; // 선을 넘어간 이미지들은 보이지 않도록 처리합니다.
`;

export default CarouselWrapper;
